import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Landing from './Landing';
import Cookies from 'js-cookie';

function App() {
  const is_logged_in = Cookies.get('login') === 'true';

  return (
    <Router>
      <Routes>
        <Route path="/" element={is_logged_in ? <Main /> : <Navigate to="/landign" />} />
        <Route path="/panel" element={is_logged_in ? <About /> : <Navigate to="/login" />} />
      </Routes>
    </Router>
  );
}

export default App;
